import React, { Component } from 'react';

class Game extends Component {

    state = {
        questions: []
    }

    componentDidMount() {
        fetch('http://localhost:3000/questions')
        .then(res => res.json())
        .then(questions => {
            this.setState({
                questions: questions
            })
        })
    }

    render() {
        return (
            <div>
                <h3>Lutrivia</h3>
            </div>
        )
    }
}

export default Game;
